# Load required libraries
library(hms)
library(shiny)
library(tibble)
library(lubridate)
library(dplyr)
library(readr)
library(plotly)
library(DT)
library(janitor)
library(here)
library(memoise)

# Helper Functions
convert_to_hours <- function(time_str) {
  if (is.character(time_str)) {
    result <- numeric(length(time_str))
    result[time_str == "dnf"] <- NA

    non_dnf <- time_str != "dnf"
    if (any(non_dnf)) {
      parts <- strsplit(time_str[non_dnf], ":")
      hours <- sapply(parts, function(x) {
        if (length(x) == 3) {
          return(as.numeric(x[1]) + as.numeric(x[2])/60 + as.numeric(x[3])/3600)
        } else if (length(x) == 2) {
          return(as.numeric(x[1]) + as.numeric(x[2])/60)
        } else {
          return(NA)
        }
      })
      result[non_dnf] <- hours
    }
    return(result)
  }
  return(time_str)
}

get_breaks <- function(x) {
  if (is.null(x) || length(x) == 0) return(NULL)
  if (max(x, na.rm = TRUE) <= 10) {
    return(seq(0, ceiling(max(x, na.rm = TRUE)), by = 1))
  } else {
    return(pretty(c(0, max(x, na.rm = TRUE)), n = 8))
  }
}

# Load and preprocess data
wser_splits <- read_csv(here("data", "wser_split_data_2017_2024.csv")) %>% 
  clean_names() %>% 
  add_column(olympic_valley_time = as_hms(00:00:00), .after = "country")

wser_cp_table <- read_csv(here("data", "wser_cp_table.csv"))
wser_course_checkpoints <- read_csv(here("data", "wser_course_checkpoints.csv")) 
html_content <- readLines(here("data", "wser_splitproject.html"))

# Pre-process static data
wser_splits_processed <- wser_splits %>%
  mutate(
    time_hours = convert_to_hours(time),
    result_type = case_when(
      time == "dnf" ~ "dnf",
      !is.na(convert_to_hours(time)) & convert_to_hours(time) < 24 ~ "silver",
      !is.na(convert_to_hours(time)) & convert_to_hours(time) >= 24 & convert_to_hours(time) <= 30 ~ "bronze",
      TRUE ~ "other"
    ),
    across(ends_with("_time"), convert_to_hours)
  )

# Define color schemes
gender_colors <- c("M" = "#0BB8E7", "F" = "#FF6B88", "All" = "#8B8B8B")

# UI Definition
ui <- fluidPage(
  h1("WSER 100 Results Analysis", align = "center"),
  tags$hr(style = "border-color: #4682B4;"),

  tabsetPanel(
    # Finish Time Distribution Tab
    tabPanel("Finish Time Distribution",
             sidebarLayout(
               sidebarPanel(
                 tags$style(type = "text/css", ".irs-grid-pol.small {height: 0px;}"),
                 sliderInput("year_range",
                           "Select Years:",
                           min = min(wser_splits$year),
                           max = max(wser_splits$year),
                           value = c(min(wser_splits$year), max(wser_splits$year)),
                           step = 1,
                           sep = ""),

                 div(style = "display: flex; gap: 20px;",
                     div(style = "flex: 1;",
                         radioButtons("gender",
                                    "Select Gender:",
                                    choices = list("All" = "All",
                                                 "Female" = "F",
                                                 "Male" = "M"),
                                    selected = "All")
                     ),
                     div(style = "flex: 1;",
                         radioButtons("result",
                                    "Select Result:",
                                    choices = list(
                                      "All finishes" = "all_finishes",
                                      "Bronze Buckle (24 to 30 hours)" = "bronze",
                                      "Silver Buckle (sub 24 hours)" = "silver",
                                      "DNF" = "dnf"
                                    ),
                                    selected = "all_finishes")
                     )
                 ),

                 sliderInput("age_range",
                           "Age Range:",
                           min = min(wser_splits$age, na.rm = TRUE),
                           max = max(wser_splits$age, na.rm = TRUE),
                           value = c(min(wser_splits$age, na.rm = TRUE), max(wser_splits$age, na.rm = TRUE))),

                 # Rest of the sidebar panel content...
                 # [Previous UI content remains the same]
               ),

               mainPanel(
                 plotlyOutput("finish_dist_plot"),
                 DTOutput("finish_summary_table")
               )
             )
    ),

    # [Rest of the UI tabs remain the same...]
  )
)

# Server logic
server <- function(input, output, session) {
  # Enable caching
  options(shiny.cache = TRUE)

  # Main reactive dataset
  filtered_data <- reactive({
    req(input$year_range, input$age_range, input$gender)

    # Base filtering
    data <- wser_splits_processed %>%
      filter(
        year >= input$year_range[1],
        year <= input$year_range[2],
        age >= input$age_range[1],
        age <= input$age_range[2]
      )

    # Gender filter
    if (input$gender != "All") {
      data <- data %>% filter(gender == input$gender)
    }

    # Result type filter
    data <- switch(input$result,
                  "all_finishes" = data %>% filter(result_type %in% c("silver", "bronze")),
                  "silver" = data %>% filter(result_type == "silver"),
                  "bronze" = data %>% filter(result_type == "bronze"),
                  "dnf" = data %>% filter(result_type == "dnf"),
                  data
    )

    return(data)
  })

  # Cache total entrants calculation
  cached_total_entrants <- memoise::memoise(function(year_range) {
    wser_splits %>%
      filter(year >= year_range[1], year <= year_range[2]) %>%
      group_by(year) %>%
      summarise(total_entrants = n())
  })

  # Cached gender counts
  cached_gender_counts <- memoise::memoise(function(year_range, gender_filter) {
    data <- wser_splits %>%
      filter(year >= year_range[1], year <= year_range[2])

    if (gender_filter != "All") {
      data <- data %>% filter(gender == gender_filter)
    }

    data %>%
      group_by(year, gender) %>%
      summarise(total_gender = n())
  })

  # Optimized finish distribution plot
  output$finish_dist_plot <- renderPlotly({
    plot_data <- filtered_data()

    if (nrow(plot_data) == 0) {
      return(plot_ly() %>% 
             layout(title = "No data available for the selected filters") %>%
             config(displayModeBar = FALSE))
    }

    if (input$result == "dnf") {
      p <- plot_ly(plot_data, x = ~as.factor(year), color = ~gender, colors = gender_colors) %>%
        add_histogram(showlegend = TRUE) %>%
        layout(
          title = "DNFs by Year",
          xaxis = list(title = "Year"),
          yaxis = list(title = "Count"),
          barmode = "group"
        )
    } else {
      p <- plot_ly(plot_data, x = ~time_hours, color = ~gender, colors = gender_colors) %>%
        add_histogram(bins = 30, opacity = 0.7) %>%
        layout(
          title = "Distribution of Finish Times",
          xaxis = list(title = "Finish Time (hours)", range = c(0, 30)),
          yaxis = list(title = "Count"),
          barmode = "overlay"
        ) %>%
        layout(showlegend = TRUE)
    }

    p %>% config(displayModeBar = FALSE)
  })

  # Cached checkpoint calculations
  cached_checkpoint_data <- memoise::memoise(function(start_cp, end_cp, data) {
    data %>%
      mutate(
        time_diff = !!sym(paste0(end_cp, "_time")) - !!sym(paste0(start_cp, "_time")),
        time_diff_hms = as_hms(round(time_diff * 3600))
      ) %>%
      filter(!is.na(time_diff))
  })

  # Optimized checkpoint plot
  output$checkpoint_plot <- renderPlotly({
    req(input$start_checkpoint, input$end_checkpoint)

    plot_data <- cached_checkpoint_data(
      input$start_checkpoint,
      input$end_checkpoint,
      filtered_data()
    )

    if (nrow(plot_data) == 0) {
      return(plot_ly() %>% 
             layout(title = "No data available") %>%
             config(displayModeBar = FALSE))
    }

    p <- plot_ly(plot_data, x = ~age, y = ~time_diff,
                color = ~gender, colors = gender_colors,
                type = "scatter", mode = "markers") %>%
      layout(
        title = paste("Time vs Age Between",
                     wser_cp_table$cp_display_name[wser_cp_table$cp_column == input$start_checkpoint],
                     "and",
                     wser_cp_table$cp_display_name[wser_cp_table$cp_column == input$end_checkpoint]),
        xaxis = list(title = "Age"),
        yaxis = list(title = "Time (hh:mm:ss)")
      )

    # Add smoothing only if enough data points
    if (min(table(plot_data$gender)) >= 5) {
      p <- p %>% add_lines(
        data = plot_data,
        x = ~age,
        y = fitted(loess(time_diff ~ age)),
        color = ~gender,
        line = list(width = 2),
        showlegend = FALSE
      )
    }

    p %>% config(displayModeBar = FALSE)
  })

  # [Rest of the server logic with similar optimizations...]

  # Update end_checkpoint choices
  observe({
    req(input$start_checkpoint)

    start_cp_number <- wser_cp_table %>%
      filter(cp_column == input$start_checkpoint) %>%
      pull(cp_number)

    choices <- wser_cp_table %>%
      filter(cp_number > start_cp_number) %>%
      { setNames(.$cp_column, .$cp_display_name) }

    updateSelectInput(session, "end_checkpoint", choices = choices)
  })
}

# Run the application
shinyApp(ui = ui, server = server)
